import React from 'react';
import ReturnMoney from './Money';
import { useNavigate } from 'react-router-dom';
import { gsap, Expo } from 'gsap';

// Money send Component
export default function WithdrAwFC() {

 const navigation = useNavigate();

 React.useEffect(() => {

  const data = window.localStorage.getItem('ACTIVE');
  JSON.parse(data) != true && navigation('/');
  JSON.parse(window.localStorage.getItem('#62^^ts@&')) != true && navigation('/dash');

  window.setTimeout(() => {
   gsap.to('.App-loading-blank', 0, { delay: .1, x: '-1000%', opacity: 0, ease: Expo.easeIn })
  }, 50);

 }, []);

 return (
  <>
   <div className='App-loading-blank'></div>
   <ReturnMoney />
  </>
 );
};
